import React from "react";
import {
  Typography,
  Box,
  Button,
  Avatar,
  Input,
  Checkbox,
  Link,
  Divider,
} from "@material-ui/core";

const signUp = () => {
  return (
      <div  style={{ backgroundColor:"#3598DC"}}>
    <div
      style={{
        display: "flex",
        flexDirection: "row",
        justifyContent: "center",
        alignItems: "center",
      }}
    >
      <Box
        style={{
          borderRadius: "2px",
          width: "350px",
          height: "490px",
          backgroundColor: "#F7F7F7",
          padding: "20px",
          margin: "30px",
        }}
        boxShadow={1}
      >


        <Typography
          style={{ color: "333333", textAlign: "left", fontSize: "30px ",fontweight:"bold"}}
        >
          Sign in{" "}
        </Typography>
      </Box>
    </div>
    </div>
  );
};

export default signUp;
